    /*METODO AJAX*/
    $(""#btn-guardar"").on(""click"", function (e) {

        if (!$(""form"").valid()) {
            return;
        }

        e.preventDefault();

        $.ajax({
            type: ""POST"",
            data: $(""form"").serialize(),
            url: ""/Promocion/Insert"",
            beforeSend: function () {
                $("".contenedor-loader"").slideToggle();
            },
            success: function (r) {
                $("".contenedor-loader"").slideToggle();
